import React from 'react';
import { createUseStyles } from 'react-jss';
const useStyles = createUseStyles({
	lightbox: {
		zIndex: '1',
		position: 'fixed',
		top: 0,
		left: 0,
		width: '100%',
		height: '100%',
		backgroundColor: 'rgba(255, 255, 255, 0.5)',
		display: 'grid',
		gridTemplateColumns: 'repeat(3, 1fr)',
		gridGap: '1em',
		alignItems: 'center',
		justifyItems: 'center',
	},
});


export function LightBoxImage(props) {
	return <img className={lightboxImg} src={props.regular} alt={props.description}></img>;
}
